import React from "react";

function Applicants_Page({ adId, findFullProfiles, hideButton }) {
  const buttonMethods = () => {
    findFullProfiles();
    hideButton();
  };

  return (
    <div>
      <section id="section">
        <div class="container">
          <div class="row">
            <div class="col-md-8 mx-auto text-center">
              <h1>Your Applications For Ad {adId} </h1>
              <p> Click Below to View Your Applications</p>
              <button class="show-profile" onClick={buttonMethods}>
                View Applications
              </button>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
}

export default Applicants_Page;
